// SPDX-License-Identifier: Unlicensed
// Jin Hong Kuan 2021 Copyrighted
pragma solidity ^0.8.0;

import "../Keylink.sol"; 
import "../ILiquidationCheck.sol";
import "../IDelegator.sol";
import "../libraries/BytesLib.sol"; 
import "@openzeppelin/contracts/token/ERC20/IERC20.sol"; 

contract KeylinkDelegator is IDelegator {

    enum Mode {
        none,
        payToClaim,
        timedDelegatedKey 
    }

    struct payToClaim {
        address token;
        uint256 amount;
    }

    struct timedDelegatedKey {
        uint256 validDuration;
        uint256 expiryBlock;
        address delegatedTo;
    }

    Keylink _keylink; 
    mapping(uint256 => Mode) private _modes;
    mapping(uint256 => payToClaim) private _payToClaims;
    mapping(uint256 => timedDelegatedKey) private _timedDelegatedKeys;
    mapping(uint256 => uint256[]) private _keys;
    mapping(uint256 => address) private _owners;
    mapping(uint256 => address) private _approvals;
    mapping(uint256 => bool) private _needApprovals;


    uint256 private _counter = 0;

    constructor(address keylink_) {
        _keylink = Keylink(keylink_);
    }

    function isDelegator() external override pure returns(bool) {
        return true;
    }

    function entrust(uint256 id, uint256 index, Mode _mode, bool _needApproval, bytes memory _args) external {
        require(_keylink.ownerOf(id, index) == msg.sender);
        require(_mode != Mode.none, "KeyDelegator: Invalid mode");
        _keylink.transferFrom(address(this), id, index);
        string memory argsInvalid = "KeyDelegator: Supplied arguments does not match mode";
        if (_mode == Mode.payToClaim) {
            require(_args.length == 52, argsInvalid); 
            address token; 
            assembly {
                token := mload(add(_args, 20))
            }
            _payToClaims[_counter] = payToClaim(token, BytesLib.toUint256(_args, 20));
        } else if (_mode == Mode.timedDelegatedKey) {
            require(_args.length == 32, argsInvalid); 
            _timedDelegatedKeys[_counter] = timedDelegatedKey(BytesLib.toUint256(_args, 0), 0, address(0));
        }
        _modes[_counter] = _mode;
        _owners[_counter] = msg.sender;
        _keys[_counter] = new uint256[](2); 
        _keys[_counter][0] = id;
        _keys[_counter][1] = index; 
        _needApprovals[_counter] = _needApproval;
        _counter++;

    }

    function acquire(uint256 id) payable external {
        require (_needApprovals[id] && (_approvals[id] != msg.sender), "KeyDelegator: You have not been approved to acquire this key");
        if (_modes[id] == Mode.payToClaim) {
            _payToClaimPayment(id);
            _keylink.transfer(msg.sender, _keys[id][0], _keys[id][1]);
        } else if (_modes[id] == Mode.timedDelegatedKey) {
            _delegateTimedKey(id);
        }
    }

    function delegatedTo(uint256 id, uint256 index) external view override returns(address) {
        uint256 i = _search(id, index);
        if (block.timestamp > _timedDelegatedKeys[i].expiryBlock) {
            return address(this); 
        } else {
            return _timedDelegatedKeys[id].delegatedTo;
        }
    }
    

    function _search(uint256 id, uint256 index) internal view returns(uint256 ret) {
        for (uint i = 0; i < _counter; i++) {
            if (_keys[i][0] == id && _keys[i][1] == index) {
                return i;
            }
        }
        require(false, "Non-existent pair");
    }

    
    function _payToClaimPayment(uint256 id) internal {
        if (_payToClaims[id].token == address(0)) {
            require(msg.value >= _payToClaims[id].amount, "KeyDelegator: Insufficient deposit payment");
            address payable sender = payable(msg.sender);
            sender.transfer(msg.value - _payToClaims[id].amount);
        } else {
            IERC20 token = IERC20(_payToClaims[id].token);
            require(token.allowance(msg.sender, address(this)) >= _payToClaims[id].amount, "KeyDelegator: Insufficient deposit payment");
            token.transferFrom(msg.sender, address(this), _payToClaims[id].amount);
        } 
    }

    function _delegateTimedKey(uint256 id) internal {
        require(_timedDelegatedKeys[id].delegatedTo == address(0) || _timedDelegatedKeys[id].expiryBlock < block.timestamp, "KeyDelegator: Key unavailable, currently delegated to another user");
        _timedDelegatedKeys[id].delegatedTo = msg.sender; 
        _timedDelegatedKeys[id].expiryBlock = block.timestamp + _timedDelegatedKeys[id].validDuration;
    }

    

